AXIS ASSISTANT is an App conceived as a tool to: find a given angle, detect tilt and also to measure a sector size in degrees.

This tool can be useful in many applications such as:

• The steepness of a slope;
• Can be used for hanging pictures, diplomas or photographs on a wall;
• Useful for photography to detect the horizon;
• It measures the angle of an arc (for example in architecture);
• And much more, your imagination is the limit.

You know that moment when you receive a WhatsApp Audio but you can't hear it? The solution to your problem has arrived! WhatsAudio transcribe your audios to texts in just 3 taps. And the best of all: you don't need to leave WhatsApp for it. As soon as you download the app, a WhatsAudio extension is automatically created inside your WhatsApp. This way, you can convert speech to text in a very accurately and practical way.

Main features:
- Convert your WhatsApp audios to text;
- Transcribe audios of any length;
- Transcription of unlimited numbers of audios;
- The moment you download the app, a WhatsAudio extension is automatically installed on your WhatsApp which allows you to convert your audios to text without having to leave WhatsApp;
- Supports over 50 languages.

To download WhatsAudio, a fee of only US$1.99 is charged, which allows you to have unlimited lifetime access to the app's features.

Se você gosta da sua agenda organizada e padronizada com o +55 (código internacional do Brasil), este é o app.

O Brasil +55 analisa sua agenda, mostra uma prévia de como devem ficar os números e atualiza todos os seus contatos com o +55.

Exemplos:
De: 5555-5555
Para: +55 (11) 5555-5555

De: 94444-4444
Para: +55 (11) 94444-4444

De: (021) 2333-3333
Para: +55 (21) 2333-3333

De: (031 16) 4222-2222
Para: +55 (16) 4222-2222

CARACTERÍSTICAS:
- Insere o +55 em todos os números;
- Remove o +55 de todos os números;
- Pré-visualização dos números a serem atualizados;
- Reconhece números com 9 Dígitos e altera corretamente;
- Reconhece e trata corretamente números no formato 4004-xxxx e 3003-xxxx;
- Ignora números com # ou * (Rádio);
